#include<bits/stdc++.h>
using namespace std;
int main()
{
    int a,b,f,k;
    scanf("%d%d%d%d",&a,&b,&f,&k);
    int ans=0;
    while(k>0)
    {
        if(a-f>=b)
        {
            ans++;
            k--;
            a=f;
            f=0;
        }
        else
        {
            f+=b;
            ans++;
            k--;
        }
    }
    if(k==0)
    {
        printf("%d",ans);
    }
    else
    {
        printf("-1");
    }
    return 0;
}

#include <bits/stdc++.h>
using namespace std;
int main()
{
    int a,b,f,k;
    cin>>a>>b>>f>>k;
    int ans=0;
    while(k>0)
    {
        if(a-f<=b)
        {
            ans++;
            k--;
            a=f;
        }
        else
        {
            ans++;
            k--;
            b=b-a+f;
            a=f;
        }
    }
    cout<<ans;
    return 0;
}

